(6, 839817, 'Xét nghiệm phân', 'KIểm tra, phân tích mẫu phân động vật có dấu hiệu của bệnh lí liên quan', 300000, 0),
(7, 357632, 'Xét nghiệm da', 'Kiểm tra phân tích mẫu da hoặc vảy gàu trên da với những động vật có biểu hiện bệnh lí về da', 200000, 0),
(8, 556506, 'Siêu âm thai', 'Siêu âm kiểm tra tổng số thai, lượng nước ối, sơ lược tuổi thai và dự kiến ngày sinh của động vật', 150000, 0),
(9, 155304, 'Siêu âm ổ bụng', 'Kiểm tra ổ bụng của động vật khi có nghi ngờ đến các bệnh về tiêu hóa', 100000, 0),
(10, 177728, 'X-Quang', 'Chụp hình cơ thể động vật chẩn đoán các bệnh lí liên quan về hô hấp, xương khớp, ...', 340000, 0),
(11, 867989, 'Phẫu thuật triệt sản cho động vật đực', 'Loại bỏ bộ phận hoặc liên bộ phận sinh dục của động vật', 500000, 1),
(12, 145562, 'Phẫu thuật triệt sản cho động vật cái', 'Loại bỏ bộ phận hoặc liên bộ phận sinh dục của động vật', 1200000, 1),
(13, 212440, 'Phẫu thuật sinh (đẻ) cho động vật', 'Can thiệp ngoại khoa khi động vật có triệu chứng chuyển dạ, thai lưu, thai nhi nhịp tim yếu, ....', 2000000, 1),
(14, 877440, 'Đặt ống thông tiểu cho động vật', 'Can thiệp khi động vật có bệnh lí liên quan đến bàng quang, thận, ...', 800000, 1),
(15, 315226, 'Tháo thụt cho động vật', 'Can thiệp khi động vật có bệnh lí liên quan đến đại trực tràng', 1000000, 1),
(16, 487545, 'Phẫu thuật chuyển giới cho động vật', 'Can thiệp khi động vật có bệnh lí liên quan đến bàng quang, thận mãn tính', 1800000, 1),
(17, 772287, 'Phẫu thuật khác', 'Các phẫu thuật, thủ thuật khác liên quan đến động vật', 3000000, 1),
(18, 297370, 'Tiêm điều trị ngoại trú', 'Tiêm điều trị cho động vật với các bệnh lí nhẹ có thể điều trị ngoại trú', 200000, 2),
(19, 714045, 'Tiêm hậu phẫu', 'Tiêm hẫu phẫu cho các ca sau khi mổ theo chỉ định của bác sĩ', 150000, 2);
